BEGIN TRANSACTION;

CREATE TABLE leagues (
id INTEGER NOT NULL, 
name VARCHAR NOT NULL, 
PRIMARY KEY (id) 
);

CREATE TABLE teams (
id INTEGER NOT NULL, 
name VARCHAR NOT NULL, 
PRIMARY KEY (id)
);

CREATE TABLE players (
id INTEGER NOT NULL, 
name VARCHAR NOT NULL, 
position VARCHAR, 
age INTEGER, 
PRIMARY KEY (id)
);

CREATE TABLE transfers (
id INTEGER NOT NULL, 
player_id INTEGER NOT NULL, 
team_from_id INTEGER, 
league_from_id INTEGER, 
team_to_id INTEGER, 
league_to_id INTEGER, 
season VARCHAR, 
market_value INTEGER, 
transfer_fee INTEGER, 
PRIMARY KEY (id), 
FOREIGN KEY(player_id) REFERENCES players (id) ON DELETE CASCADE,
FOREIGN KEY(team_from_id) REFERENCES teams (id) ON DELETE CASCADE,
FOREIGN KEY(league_from_id) REFERENCES leagues (id) ON DELETE CASCADE,
FOREIGN KEY(team_to_id) REFERENCES teams (id) ON DELETE CASCADE,
FOREIGN KEY(league_to_id) REFERENCES leagues (id) ON DELETE CASCADE
);








COMMIT;